import React from "react";
import h_bg from "../assets/h_bg.jpg";
import './Header.css';

const Header = () => {
  return (
    <div className="home_header">
      
      <img src={h_bg} alt="Background" className="img-fluid" />
      <p className="text-overlay">Find The Best Place To Live As Undergraduate</p>

      <nav class="navbar bg-body-tertiary">
        <div class="container-fluid"  style={{justifyContent:"center"}}>
          <form class="d-flex" role="search">
            <input class="form-control me-1" type="search" placeholder="Search" aria-label="Search" style={{maxWidth:"350px",Width:"100px"}}/>
            <button class="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </nav>
      
    </div>
  );
};

export default Header;
